import React from 'react';
import {
  ChakraProvider,
  Box,
  Container,
  Heading,
  Text,
} from '@chakra-ui/react';

function App() {
  return (
    <ChakraProvider>
      <Container bg ="white" minH="100vh" minW="100vw">
        <Heading>
          <Text color="black">Hello World</Text>
        </Heading>
        <Box>
        halo
        </Box>
      </Container>
    </ChakraProvider>
  );
}

export default App;
